import Box from '@mui/material/Box';
import Drawer from '@mui/material/Drawer';
import Divider from '@mui/material/Divider';
import { useTypedController } from "@hookform/strictly-typed"
import { useForm } from 'react-hook-form';
import {  Button, TextField } from '@mui/material';
import { PriceType } from './MainTable';

type DrawerListProps = {
  data: PriceType | null,
  onClose: () => void
  saveForm: React.Dispatch<React.SetStateAction<PriceType[]>>
}

const DrawerBtcTable = (props: DrawerListProps) => {
  const { data, onClose, saveForm } = props

  const { handleSubmit, control } = useForm<PriceType>({
    mode: "onChange",
    defaultValues: data ?? { code: "", symbol: 0, rate: 0, description: 0, rate_float: 0 }
  })

  const TypedController = useTypedController<PriceType>({ control })

  const handleOnSubmit = (form: PriceType) => {
    saveForm((oldValue) => {
      const newValue = oldValue.map((field) => {
        if (field.code === form.code) {
          return form
        } else {
          return field
        }
      })
      return (newValue) 
    }) 
    onClose()
  }

  return (
    <div>
      <Drawer open={data ? true : false} anchor={"right"} onClose={onClose}>
        <form onSubmit={handleSubmit(handleOnSubmit)}>
          <Box sx={{ width: 600 }} className="p-8" role="presentation" >
            <h1 className="text-xl font-bold">
              Edit Dessert 
            </h1>
            <div className='flex flex-col gap-4 m-4'>
              <TypedController
                name="code"
                disabled
                render={({ value, onChange }) => (
                  <div className="flex flex-row items-center">
                    <TextField value={value} onChange={onChange} label="Code" disabled />
                  </div>
                )}
              />
              <TypedController
                name="symbol"
                render={({ value, onChange }) => (
                  <div className="flex flex-row items-center">
                    <TextField value={value} onChange={onChange} label="Symbol" />
                  </div>
                )}
              />
              <TypedController
                name="rate"
                render={({ value, onChange }) => (
                  <div className="flex flex-row items-center">
                    <TextField value={value} onChange={onChange} label="Rate" />
                  </div>
                )}
              />
              <TypedController
                name="description"
                render={({ value, onChange }) => (
                  <div className="flex flex-row items-center">
                    <TextField value={value} onChange={onChange} label="Description" />
                  </div>
                )}
              />
              <TypedController
                name="rate_float"
                render={({ value, onChange }) => (
                  <div className="flex flex-row items-center">
                    <TextField value={value} onChange={onChange} label="Rate Float" />
                  </div>
                )}
              />
            </div>
            <Button type="submit">Save</Button>
            <Divider />
          </Box>
        </form>
      </Drawer>
    </div>
  );
}

export default DrawerBtcTable
